import React from 'react';

import ScheduleFrameRow from '../ScheduleFrameRow/ScheduleFrameRow';

import styles from './SheduleFrame.module.css';


export default ({ items, handleClick }) => {
  const rows = [];
  let row = [];

  for (let i = 0; i < items.length; i++) {
    row.push(items[i])
    if (items[i]['weekDay'] === "0") {
      rows.push(row);
      row = [];
    }
  }

  const weekDayAdapter = {
    0: 'Вс.',
    1: 'Пн.',
    2: 'Вт.',
    3: 'Ср.',
    4: 'Чт.',
    5: 'Пт.',
    6: 'Сб.',
  }

	return (
		<table className={styles.items}>
      <thead>
        {/* <tr> */}
        <th>Пн.</th>
        <th>Пн.</th>
        <th>Пн.</th>
        <th>Пн.</th>
        <th>Пн.</th>
        <th>Пн.</th>
        <th>Пн.</th>
        {/* </tr> */}
      </thead>
      {rows.map(row => <ScheduleFrameRow handleClick={handleClick} row={row}/>)}
		</table>
	);
};
